Tecaj plivanja (1988) Domaci Film

Rezija: Zrinko Ogresta

Uloge: Jovan Licina, Maja Dimitrijevic, Sinisa Popovic, Suzana Nikolic, Vera Zima, Zvonimir Zoricic, Smiljka Bencet, Slavica Jukic, Danko Ljustina...

Opis: Bracni par intelektualaca, zasao u trecu dob, nespreman je da se ukljuci i prihvati okrutna pravila koja im namece zivot... Ogresta je uz aktualnost gradje u tekstu iznasao mogucnost da se o savremenosti progovori i preko ljubavi, a to je jedino sto je vremesnom bracnom paru preostalo. Stoga je i rediteljski rukopis ovog filma u pojedinim scenama blizak poetskom realizmu...

